('62a0cbf6c9900', '20020800264', 'RETNO SARIDEWI', 'KEPALA BIDANG', '5', 'SATUAN KERJA HUKUM DAN SDM', 'DEPARTEMEN SDM', 'BIDANG PEMBELAJARAN SDM', 'BIDANG PEMBELAJARAN SDM', '20211101883', 'KLIN AGUSTA HERNANDI', 'TRAINEE BSIT', '2', 'SATUAN KERJA HUKUM DAN SDM', 'DEPARTEMEN SDM', 'BIDANG PEMBELAJARAN SDM', 'BIDANG PEMBELAJARAN SDM', 1, '2021-06-21', '2022-06-21', 'Mambuat aplikasi penomoran surat masuk-keluar dalam 3 bulan dimulai dari 15 Mei 2022', 'progress aplikasi telah berjalan 50% dalam hingga saat ini', 'Rewrite aplikasi-aplikasi EOS di Q3 2022', 'Akan dikerjakan setelah  aplikasi penomoran surat selesai', 'Pelajari API dan implementasinya', 'progres belajar 50%', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Tidak memiliki permasalahan perilaku. ', 'Harus lebih inisiatif', 'Semangat bekerja ditingkatkan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Hallo kamu semangat yaaa\r\nJaga kesehatan juga\r\n', 0, '2022-06-02 08:39:18', '2022-07-03 21:48:17', '0000-00-00 00:00:00'),
('62a0cc10f3d88', '20190101570', 'RODIANAH', 'KEPALA DEPARTEMEN', '6', 'SATUAN KERJA HUKUM DAN SDM', 'DEPARTEMEN SDM', 'DEPARTEMEN SDM', 'DEPARTEMEN SDM', '20141201109', 'DICKY DWIJAYANTO', 'ASSOCIATE OFFICER', '4', 'SATUAN KERJA HUKUM DAN SDM', 'DEPARTEMEN SDM', 'FUNGSI PEMENUHAN SDM', 'FUNGSI PEMENUHAN SDM', 1, '2022-06-21', NULL, 'Program kerja pemenuhan SDM', 'Sudah terpenuhi semua kecuali 1 staff AMU, karena user masih belum cocok dengan beberapa  kandidat yang sudah diberikan.', 'Program Pembuatan Kamus Kompetensi', 'Belum berjalan tahun 2021', 'Program Panel Management', 'Belum berjalan tahun 2021', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sudah cepat tanggap dalam memahami kebutuhan User', ' Tingkatkan kedisplinan kehadiran dan konsisten dalam menjalankan pencatatan kehadiran', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Lorem ipsum, dolor sit amet consectetur adipisicing elit. Repellendus sapiente nisi consequatur laudantium, earum at reprehenderit maxime sequi fugiat asperiores animi, deserunt natus! Beatae officia rerum qui cum quia vero?\r\nLorem ipsum dolor sit amet consectetur adipisicing elit. Aliquam cumque facilis repellat voluptatibus, fugiat modi perspiciatis, autem inventore adipisci odit doloremque iusto ut, molestiae omnis tempore. Accusamus modi soluta necessitatibus!\r\n', 0, '2022-06-02 09:21:48', '2022-07-03 21:49:45', '0000-00-00 00:00:00'),
('62a0cc1f87a17', '20190101570', 'RODIANAH', 'KEPALA DEPARTEMEN', '6', 'SATUAN KERJA HUKUM DAN SDM', 'DEPARTEMEN SDM', 'DEPARTEMEN SDM', 'DEPARTEMEN SDM', '20020800264', 'RETNO SARIDEWI', 'KEPALA BIDANG', '5', 'SATUAN KERJA HUKUM DAN SDM', 'DEPARTEMEN SDM', 'BIDANG PEMBELAJARAN SDM', 'BIDANG PEMBELAJARAN SDM', 1, '2022-06-21', '2022-06-23', 'Program sertifikasi dan refreshment', 'Telah terpenuhi', 'pembuatan materi e learning PDPS dan anti fraud bekerjasama dengan vendor', 'Telah tercapai 90% harus di carry forward ke tahun 2022 karena narasumber wafat', 'Program sertifikasi BSMR Level 5 Untuk tahun 2022', 'Telah diselesaikan di tahun 2021 untuk pengurus, level berikutnya akan tetap dilaksanakan di tahun 2022', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Tidak menyerah atas kegagalan pada saat proses sertifikasi tresuri dan terus mencari solusi agar peserta dapat lulus dengan hasil kompeten', 'Konsisten dalam menjalankan proses training walaupun keadaan tidak mendukung karena adanya pandemi dan infrastructure pembelajaran yang masih belum memadai', 'Perlu meningkatkan kemampuan memberdayakan anggota team', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Mengajak team untuk diberikan tugas yang tidak hanya daily namun sudah mulai membuat konsep contoh mendukung pembuatan kebijakan Sertifikasi BSMR yang bekerjasama dengan unit kerja MRK (sudah berkordinasi pada bulan desember 2021), ikut terlibat dalam project pembuatan roadmap training BCA Syariah. \r\nPerlu adanya peningkatan kompetensi jabatan melalui sertifikasi Manajemen SDM bidang training yang akan dilaksanakan pada semester 2 tahun 2022.      \r\n', 0, '2022-06-02 12:48:53', '2022-07-03 21:49:55', '0000-00-00 00:00:00'),
