(1, 'PENGETAHUAN JABATAN', '<div><span style=\"font-size: 1rem;\">Penguasaan atas informasi yang mendukung pekerjaan</span><br></div><div><br></div><div><b>Indikator:</b></div><ol><li>Menguasai pengetahuan yang terkait dengan pelaksanaan tugas dan tanggung jawab.</li><li>Menguasai ketentuan dan peraturan perusahaan yang berlaku.</li><li>Trampil menggunakan alat-alat kerja yang berhubungan dengan pekerjaan.</li></ol><p><br></p><table class=\"table table-bordered\" style=\"width:100%\"><tbody><tr><td><b>Kategori Penilaian Kinerja</b></td><td><b><br></b></td><td><b>Nilai</b></td></tr><tr><td>Sangat Melampaui Tuntutan Pekerjaan<br></td><td>(&gt;100%)</td><td>4</td></tr><tr><td>Melampaui Tuntutan Pekerjaan<br></td><td>(100-110%)</td><td>3</td></tr><tr><td>Melaksanakan Sebagian Tuntutan Pekerjaan<br></td><td>(80-99%)</td><td>2</td></tr><tr><td>Jauh dari Tuntutan Pekerjaan<br></td><td>(&lt;80%)</td><td>1</td></tr></tbody></table><p><br></p>', '2022-06-16 18:40:40', '2022-06-19 22:37:18', '2022-06-16 18:40:40'),
(2, 'ADAPTASI', '<div><div><div>Kemampuan menyesuaikan diri baik terhadap tugas dan pekerjaan,maupun lingkungan baru.<span style=\"white-space:pre\">											</span></div></div></div><div><br></div><div><b>Indikator:</b></div><ol><li>Kemampuan menyesuaikan diri dengan lingkungan kerja (rekan kerja, situasi, tugas-tugas baru).</li><li>Kemampuan untuk bekerja dengan baik meski dalam tekanan (volume kerja, waktu).</li><li>Mampu menghadapi tekanan pekerjaan untuk mencapai tujuan terbaik bagi perusahaan.</li></ol><p><br></p><table class=\"table table-bordered\" style=\"width:100%\"><tbody><tr><td><b>Kategori Penilaian Kinerja</b></td><td><b><br></b></td><td><b>Nilai</b></td></tr><tr><td>Sangat Melampaui Tuntutan Pekerjaan<br></td><td>(&gt;100%)</td><td>4</td></tr><tr><td>Melampaui Tuntutan Pekerjaan<br></td><td>(100-110%)</td><td>3</td></tr><tr><td>Melaksanakan Sebagian Tuntutan Pekerjaan<br></td><td>(80-99%)</td><td>2</td></tr><tr><td>Jauh dari Tuntutan Pekerjaan<br></td><td>(&lt;80%)</td><td>1</td></tr></tbody></table><p><br></p>', '2022-06-17 04:16:27', '2022-06-19 22:39:20', '2022-06-17 04:16:27'),
(3, 'KUALITAS KERJA', '<div><div><div>Keseimbangan antara seberapa banyak &amp; seberapa jauh pekerjaan yang diselesaikan dibandingkan dengan mutu hasil pekerjaan tersebut<span style=\"white-space:pre\">											</span></div></div></div><div><br></div><div><b>Indikator:</b></div><ol><li>Ketelitian dan mutu hasil kerja</li></ol><p><br></p><table class=\"table table-bordered\" style=\"width:100%\"><tbody><tr><td><b>Kategori Penilaian Kinerja</b></td><td><b><br></b></td><td><b>Nilai</b></td></tr><tr><td>Sangat Melampaui Tuntutan Pekerjaan<br></td><td>(&gt;100%)</td><td>4</td></tr><tr><td>Melampaui Tuntutan Pekerjaan<br></td><td>(100-110%)</td><td>3</td></tr><tr><td>Melaksanakan Sebagian Tuntutan Pekerjaan<br></td><td>(80-99%)</td><td>2</td></tr><tr><td>Jauh dari Tuntutan Pekerjaan<br></td><td>(&lt;80%)</td><td>1</td></tr></tbody></table><p><br></p>', '2022-06-17 04:17:12', '2022-06-19 22:40:40', '2022-06-17 04:17:12'),
(4, 'KEMAMPUAN KOMUNIKASI', '<div><div>kemampuan menyampaikan &amp; menerima pesan dengan baik</div><div><br></div></div><div><b>Indikator:</b></div><ol><li>Mampu menyampaikan pendapat secara sistimatik baik lisan maupun tertulis</li><li>Mau mendengar dan menerima pendapat orang lain<br></li></ol><p><br></p><table class=\"table table-bordered\" style=\"width:100%\"><tbody><tr><td><b>Kategori Penilaian Kinerja</b></td><td><b><br></b></td><td><b>Nilai</b></td></tr><tr><td>Sangat Melampaui Tuntutan Pekerjaan<br></td><td>(&gt;100%)</td><td>4</td></tr><tr><td>Melampaui Tuntutan Pekerjaan<br></td><td>(100-110%)</td><td>3</td></tr><tr><td>Melaksanakan Sebagian Tuntutan Pekerjaan<br></td><td>(80-99%)</td><td>2</td></tr><tr><td>Jauh dari Tuntutan Pekerjaan<br></td><td>(&lt;80%)</td><td>1</td></tr></tbody></table><p><br></p>', '2022-06-17 04:18:19', '2022-06-19 22:41:41', '2022-06-17 04:18:19'),
(5, 'KUALITAS PELAYANAN', '<div><div>Memiliki semangat yang tinggi untuk selalu memberikan hasil yang terbaik baik bagi Perusahaan maupun pihak yang terkait dengan Perusahaan (Stakeholders).<span style=\"white-space:pre\">									</span></div></div><div><br></div><div><b>Indikator:</b></div><ol><li>Loyalitas yang tinggi terhadap perusahaan dan selalu berusaha untuk menunjukkan penampilan pribadi yang baik</li><li>Bersikap ramah dan sopan</li><li>Sigap dan cepat tanggap dalam berhubungan dengan nasabah internal/eksternal</li></ol><p><br></p><table class=\"table table-bordered\" style=\"width:100%\"><tbody><tr><td><b>Kategori Penilaian Kinerja</b></td><td><b><br></b></td><td><b>Nilai</b></td></tr><tr><td>Sangat Melampaui Tuntutan Pekerjaan<br></td><td>(&gt;100%)</td><td>4</td></tr><tr><td>Melampaui Tuntutan Pekerjaan<br></td><td>(100-110%)</td><td>3</td></tr><tr><td>Melaksanakan Sebagian Tuntutan Pekerjaan<br></td><td>(80-99%)</td><td>2</td></tr><tr><td>Jauh dari Tuntutan Pekerjaan<br></td><td>(&lt;80%)</td><td>1</td></tr></tbody></table><p><br></p>', '2022-06-17 04:21:20', '2022-06-19 22:42:32', '2022-06-17 04:21:20'),
(6, 'DISIPLIN', '<div><div><div>Ketaatan pada peraturan perusahaan<span style=\"white-space:pre\">								</span></div></div></div><div><br></div><div><b>Indikator:</b></div><ol><li>Sigap dalam melaksanakan tugas.</li><li>Menjalankan peraturan dengan konsisten</li></ol><table class=\"table table-bordered\" style=\"width:100%\"><tbody><tr><td><b>Kategori Penilaian Kinerja</b></td><td><b><br></b></td><td><b>Nilai</b></td></tr><tr><td>Sangat Melampaui Tuntutan Pekerjaan<br></td><td>(&gt;100%)</td><td>4</td></tr><tr><td>Melampaui Tuntutan Pekerjaan<br></td><td>(100-110%)</td><td>3</td></tr><tr><td>Melaksanakan Sebagian Tuntutan Pekerjaan<br></td><td>(80-99%)</td><td>2</td></tr><tr><td>Jauh dari Tuntutan Pekerjaan<br></td><td>(&lt;80%)</td><td>1</td></tr></tbody></table><p><br></p>', '2022-06-17 04:21:56', '2022-06-19 22:43:12', '2022-06-17 04:21:56'),
(7, 'INISIATIF', '<div><div>Kemampuan melaksanakan tugas dan pekerjaan melalui berbagai cara dan upaya<span style=\"white-space:pre\">										</span></div></div><div><br></div><div><b>Indikator:</b></div><ol><li>Kecenderungan untuk bertindak atas kehendak sendiri, melalui perilaku yang tidak memerlukan pengarahan atau dorongan dari lingkungan</li><li>Memanfaatkan kesempatan, menggali informasi secara mendalam dan melakukan lebih dari apa yang diharapkan</li></ol><table class=\"table table-bordered\" style=\"width:100%\"><tbody><tr><td><b>Kategori Penilaian Kinerja</b></td><td><b><br></b></td><td><b>Nilai</b></td></tr><tr><td>Sangat Melampaui Tuntutan Pekerjaan<br></td><td>(&gt;100%)</td><td>4</td></tr><tr><td>Melampaui Tuntutan Pekerjaan<br></td><td>(100-110%)</td><td>3</td></tr><tr><td>Melaksanakan Sebagian Tuntutan Pekerjaan<br></td><td>(80-99%)</td><td>2</td></tr><tr><td>Jauh dari Tuntutan Pekerjaan<br></td><td>(&lt;80%)</td><td>1</td></tr></tbody></table><p><br></p>', '2022-06-17 04:22:43', '2022-06-19 22:43:52', '2022-06-17 04:22:43'),
(8, 'INTEGRITAS', '<div><div><div>Memiliki kejujuran dan ketulusan dalam melaksanakan tugas dan tanggung jawab sebagai bagian dari organisasi secara keseluruhan.<span style=\"white-space:pre\">											</span></div></div></div><div><br></div><div><b>Indikator:</b></div><ol><li>Mampu bekerja secara jujur, dapat dipercaya dan diandalkan baik oleh Atasan dan Rekan Kerja.</li><li>Dapat memisahkan antara kepentingan bisnis dan kepentingan pribadi.</li><li>Berperilaku sesuai dengan etika dan norma-norma sosial yang telah ditetapkan oleh perusahaan.</li></ol><p><br></p><table class=\"table table-bordered\" style=\"width:100%\"><tbody><tr><td><b>Kategori Penilaian Kinerja</b></td><td><b><br></b></td><td><b>Nilai</b></td></tr><tr><td>Sangat Melampaui Tuntutan Pekerjaan<br></td><td>(&gt;100%)</td><td>4</td></tr><tr><td>Melampaui Tuntutan Pekerjaan<br></td><td>(100-110%)</td><td>3</td></tr><tr><td>Melaksanakan Sebagian Tuntutan Pekerjaan<br></td><td>(80-99%)</td><td>2</td></tr><tr><td>Jauh dari Tuntutan Pekerjaan<br></td><td>(&lt;80%)</td><td>1</td></tr></tbody></table><p><br></p>', '2022-06-17 04:24:06', '2022-06-19 22:44:40', '2022-06-17 04:24:06'),
(9, 'KERJASAMA', '<div><div>Memiliki rasa kebersamaan sebagai sebuah tim, baik dengan atasan dan rekan kerja di unit kerja setempat &amp; unit kerja lain.&nbsp;<span style=\"white-space:pre\">								</span></div></div><div><br></div><div><b>Indikator:</b></div><ol><li>Selalu berusaha untuk memenuhi kebutuhan, keinginan dan keluhan dari pihak lain yang membutuhkan bantuan.</li><li>Melaksanakan tugas dengan sebaik mungkin sebagai anggota kelompok.</li><li>Menghargai pekerjaan orang lain.</li></ol><p><br></p><table class=\"table table-bordered\" style=\"width:100%\"><tbody><tr><td><b>Kategori Penilaian Kinerja</b></td><td><b><br></b></td><td><b>Nilai</b></td></tr><tr><td>Sangat Melampaui Tuntutan Pekerjaan<br></td><td>(&gt;100%)</td><td>4</td></tr><tr><td>Melampaui Tuntutan Pekerjaan<br></td><td>(100-110%)</td><td>3</td></tr><tr><td>Melaksanakan Sebagian Tuntutan Pekerjaan<br></td><td>(80-99%)</td><td>2</td></tr><tr><td>Jauh dari Tuntutan Pekerjaan<br></td><td>(&lt;80%)</td><td>1</td></tr></tbody></table><p><br></p>', '2022-06-17 04:25:09', '2022-06-19 22:45:26', '2022-06-17 04:25:09'),
(10, 'MANDIRI', '<div><div>Memiliki keyakinan diri yang kuat terhadap kemampuan dan ketrampilan yang dimiliki, untuk dapat melaksanakan tugas dan tanggung jawab yang diemban.<span style=\"white-space:pre\">		</span></div></div><div><br></div><div><b>Indikator:</b></div><ol><li>Keyakinan yang kuat akan setiap kemampuan, ketrampilan dan keputusan pribadi.</li><li>Kemauan untuk bekerja sebaik mungkin meskipun tidak diawasi.</li><li>Memanfaatkan kesempatan, menggali informasi secara mendalam dan melakukan lebih dari apa yang diharapkan untuk memperoleh manfaat yang maksimal</li></ol><p><br></p><table class=\"table table-bordered\" style=\"width:100%\"><tbody><tr><td><b>Kategori Penilaian Kinerja</b></td><td><b><br></b></td><td><b>Nilai</b></td></tr><tr><td>Sangat Melampaui Tuntutan Pekerjaan<br></td><td>(&gt;100%)</td><td>4</td></tr><tr><td>Melampaui Tuntutan Pekerjaan<br></td><td>(100-110%)</td><td>3</td></tr><tr><td>Melaksanakan Sebagian Tuntutan Pekerjaan<br></td><td>(80-99%)</td><td>2</td></tr><tr><td>Jauh dari Tuntutan Pekerjaan<br></td><td>(&lt;80%)</td><td>1</td></tr></tbody></table><p><br></p>', '2022-06-17 04:28:44', '2022-06-19 22:46:34', '2022-06-17 04:28:44'),
(11, 'KEMAMPUAN MANAJERIAL', '<div><div>Kemampuan untuk memotivasi dan mencapai tujuan bersama melalui orang lain<span style=\"white-space:pre\">										</span></div></div><div><br></div><div><b>Indikator:</b></div><ol><li>Kemampuan memotivasi, mengarahkan dan mengembangkan orang lain</li><li>Kemampuan mengkoordinasi dan melakukan kontrol secara efektif</li><li>Kemampuan menyusun rencana kerja dan mengambil keputusan</li></ol><table class=\"table table-bordered\" style=\"width:100%\"><tbody><tr><td><b>Kategori Penilaian Kinerja</b></td><td><b><br></b></td><td><b>Nilai</b></td></tr><tr><td>Sangat Melampaui Tuntutan Pekerjaan<br></td><td>(&gt;100%)</td><td>4</td></tr><tr><td>Melampaui Tuntutan Pekerjaan<br></td><td>(100-110%)</td><td>3</td></tr><tr><td>Melaksanakan Sebagian Tuntutan Pekerjaan<br></td><td>(80-99%)</td><td>2</td></tr><tr><td>Jauh dari Tuntutan Pekerjaan<br></td><td>(&lt;80%)</td><td>1</td></tr></tbody></table><p><br></p>', '2022-06-17 04:29:43', '2022-06-19 22:47:17', '2022-06-17 04:29:43');
